import {TableCell} from "./tableCell";
import {EditableObject} from "./editableObject";
export class EditedObject {
  private rowId: string;
  private editableObject: EditableObject;

  constructor(id: string, object: EditableObject) {
    this.rowId = id;
    this.editableObject = object;
  }

  getRowId(): string {
    return this.rowId;
  }

  getEditableObject(): EditableObject {
    return this.editableObject;
  }
}
